pragma solidity >=0.8.7;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./CommonERC20.sol";
import {IAlgebraPool} from "@cryptoalgebra/integral-core/contracts/interfaces/IAlgebraPool.sol";
import {INonfungiblePositionManager} from "@cryptoalgebra/integral-periphery/contracts/interfaces/INonfungiblePositionManager.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";
import "./PresaleReleaseExcutor.sol";

contract PresaleManager is IERC721Receiver {
    PresaleReleaseExcutor public releaseExecutor;
    address public immutable WNativeToken;
    mapping(address => Presale) public presales;
    INonfungiblePositionManager public positionManager;

    constructor(address _WNativeToken, INonfungiblePositionManager _positionManager) {
        WNativeToken = _WNativeToken;
        positionManager = _positionManager;
        releaseExecutor = new PresaleReleaseExcutor(_positionManager, _WNativeToken, this);
    }

    function putPresale(Presale memory presale) external {
        require(presales[presale.pair].presaleAmount == 0, "PresaleManager: already exists");
        presales[presale.pair] = presale;
        positionManager.transferFrom(msg.sender, address(this), presale.positionTokenId);

        emit PresaleCreated(
            msg.sender,
            presale.name,
            presale.symbol,
            presale.presaleAmount,
            presale.token,
            presale.pair,
            presale.totalSupply,
            presale.minterAllocation,
            presale.data
        );
    }

    function getPresale(address pair) external view returns (Presale memory) {
        return presales[pair];
    }

    function getProgress(address poolAddress) public view returns (uint256) {
        IAlgebraPool pool = IAlgebraPool(poolAddress);
        Presale memory presale = presales[poolAddress];
        (uint256 reserve0, uint256 reserve1) = pool.getReserves();

        if (pool.token0() == WNativeToken) {
            return (100 * reserve0) / presale.presaleAmount;
        } else {
            return (100 * reserve1) / presale.presaleAmount;
        }
    }

    function release(address poolAddress) external {
        uint256 progress = getProgress(poolAddress);
        require(progress >= 100, "PresaleManager : progress is not enough");
        uint256 tokenId = presales[poolAddress].positionTokenId;
        positionManager.transferFrom(address(this), address(releaseExecutor), tokenId);
        releaseExecutor.release(poolAddress);
    }

    function onERC721Received(
        address operator,
        address,
        uint256 tokenId,
        bytes calldata
    ) external returns (bytes4) {
        return this.onERC721Received.selector;
    }

    event PresaleCreated(
        address from,
        string name,
        string symbol,
        uint256 presaleAmount,
        address token,
        address pairAddress,
        uint256 totalSupply,
        uint256 minterAllocation,
        string data
    );
}

struct Presale {
    string name;
    string symbol;
    uint256 presaleAmount;
    address token;
    address pair;
    uint256 totalSupply;
    uint256 minterAllocation;
    string data;
    uint256 positionTokenId;
    bool released;
}","keccak256":"0xa44da1eabc56691eb8d0376c54065695962b3f59eb4d919121d4bf9e59026b18","license":"GPL-3.0"},"contracts/PresaleReleaseExcutor.sol":{"content":"// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.8.7;

import "./CommonERC20.sol";
import {IAlgebraPool} from "@cryptoalgebra/integral-core/contracts/interfaces/IAlgebraPool.sol";
import {INonfungiblePositionManager} from "@cryptoalgebra/integral-periphery/contracts/interfaces/INonfungiblePositionManager.sol";
import {IWNativeToken} from "@cryptoalgebra/integral-periphery/contracts/interfaces/external/IWNativeToken.sol";
import {TickMath} from "@cryptoalgebra/integral-core/contracts/libraries/TickMath.sol";
import {PresaleManager, Presale} from "./PresaleManager.sol";

contract PresaleReleaseExcutor {
    address public immutable WNativeToken;

    INonfungiblePositionManager public positionManager;
    PresaleManager public presaleManager;

    constructor(
        INonfungiblePositionManager _positionManager,
        address _WNativeToken,
        PresaleManager _presaleManager
    ) {
        positionManager = _positionManager;
        WNativeToken = _WNativeToken;
        presaleManager = _presaleManager;
    }

    function release(address poolAddress) external {
        require(msg.sender == address(presaleManager), "TokenMaker : FORBIDDEN");
        Presale memory presale = presaleManager.getPresale(poolAddress);
        require(presale.released == false, "TokenMaker : presale is already released");

        PositionInfo memory position = getPositionInfo(presale.positionTokenId);
        positionManager.decreaseLiquidity(
            INonfungiblePositionManager.DecreaseLiquidityParams(
                presale.positionTokenId,
                position.liquidity,
                0,
                0,
                block.timestamp + 100
            )
        );
        positionManager.collect(
            INonfungiblePositionManager.CollectParams(
                presale.positionTokenId,
                address(this),
                type(uint128).max,
                type(uint128).max
            )
        );
        positionManager.burn(presale.positionTokenId);

        IAlgebraPool pool = IAlgebraPool(poolAddress);
        uint256 wethBalance = IWNativeToken(WNativeToken).balanceOf(address(this));
        if (wethBalance > 0) {
            IWNativeToken(WNativeToken).withdraw(wethBalance);
        }

        CommonERC20 token = CommonERC20(presale.token);
        uint256 ethBalance = address(this).balance;
        uint256 tokenBalance = token.balanceOf(address(this));
        uint256 mintAmount0;
        uint256 mintAmount1;
        if (pool.token0() == WNativeToken) {
            mintAmount0 = ethBalance;
            mintAmount1 = tokenBalance;
        } else {
            mintAmount0 = tokenBalance;
            mintAmount1 = ethBalance;
        }

        int24 tickSpacing = pool.tickSpacing();
        token.approve(poolAddress, type(uint256).max);
        token.approve(address(positionManager), type(uint256).max);
        (uint256 newTokenId, uint128 _liquidity, uint256 _amount0, uint256 _amount1) = positionManager.mint{
            value: ethBalance
        }(
            INonfungiblePositionManager.MintParams(
                pool.token0(),
                pool.token1(),
                TickMath.MIN_TICK - (TickMath.MIN_TICK % tickSpacing),
                TickMath.MAX_TICK - (TickMath.MAX_TICK % tickSpacing),
                mintAmount0,
                mintAmount1,
                0,
                0,
                address(this),
                block.timestamp + 100
            )
        );
        positionManager.transferFrom(address(this), address(presaleManager), newTokenId);
    }

    function getPositionInfo(uint256 tokenId) internal view returns (PositionInfo memory) {
        (
            uint88 nonce,
            address operator,
            address token0,
            address token1,
            int24 tickLower,
            int24 tickUpper,
            uint128 liquidity,
            uint256 feeGrowthInside0LastX128,
            uint256 feeGrowthInside1LastX128,
            uint128 tokensOwed0,
            uint128 tokensOwed1
        ) = positionManager.positions(tokenId);
        return
            PositionInfo(
                nonce,
                operator,
                token0,
                token1,
                tickLower,
                tickUpper,
                liquidity,
                feeGrowthInside0LastX128,
                feeGrowthInside1LastX128,
                tokensOwed0,
                tokensOwed1
            );
    }

    receive() external payable {}

    fallback() external payable {}

    struct PositionInfo {
        uint88 nonce;
        address operator;
        address token0;
        address token1;
        int24 tickLower;
        int24 tickUpper;
        uint128 liquidity;
        uint256 feeGrowthInside0LastX128;
        uint256 feeGrowthInside1LastX128;
        uint128 tokensOwed0;
        uint128 tokensOwed1;
    }
}
